def max_product_of_two(nums):
    if len(nums) < 2:
        return -1
    max1 = max(nums[0], nums[1])
    max2 = min(nums[0], nums[1])

    for num in nums[2:]:
        if num > max1:
            max2 = max1
            max1 = num
        elif num > max2:
            max2 = num

    return max1 * max2

